function ListTodos(todos) {
    console.log(todos)
    return (
        <>
            <ul>
                {todos && todos.map((todo) => (
                    <li key={todo.id}>
                        <input type="checkbox" checked={todo.isCompleted}/>
                        <span>{todo.textTodo}</span>
                        <span className="deleteTodo">&times;</span>
                    </li>
                ))}
            </ul>
        </>
    )
}

export { ListTodos }
